const Contact = () => (
  <div className="max-w-xl mx-auto p-4">
    <h2 className="text-3xl font-bold text-blue-700">Contact Me</h2>
    <p className="mt-4 text-gray-700">Email: <a href="mailto:aanya.03024@gmail.com" className="text-blue-500 underline">aanya.03024@gmail.com</a></p>
    <p className="mt-2">GitHub: <a href="https://github.com/aanyagrawal26" target="_blank" className="text-blue-500 underline">@aanyagrawal26</a></p>
    <p className="mt-2">LinkedIn: <a href="https://linkedin.com/in/aanya-agrawal-99b1a8322" target="_blank" className="text-blue-500 underline">/aanya-agrawal-99b1a8322</a></p>
  </div>
);

export default Contact;
